/*global chrome*/
import React, { Component } from 'react'
import './App.css'
import ReactHowler from 'react-howler'

class App extends Component {
  constructor(props) {
    super(props)
    this.state = {
      showRecord: false,
      playing: false
    }
    this.showHideRecord = this.showHideRecord.bind(this)
  }

  componentDidMount() {
    window.addEventListener('keypress', this.handleAKey, false)
  }

  handleAKey(event) {
    console.log(event)
    if (event.key === 'a') {
      if (this.state.playing === true) this.audio.seek(0)
      else {
        this.setState({
          playing: true
        })
      }
    }
    if (event.key === 's') {
      if (this.state.playing === true) this.audio.seek(2.96)
      else {
        this.setState({
          playing: true
        })
      }
    }
    if (event.key === 'd') {
      if (this.state.playing === true) this.audio.seek(0.072)
      else {
        this.setState({
          playing: true
        })
      }
    }
  }

  showHideRecord() {
    this.setState({ showRecord: !this.state.showRecord })
    console.log(this.state.showRecord)
  }
  render() {
    let something = chrome.extension.getURL('./dipquant.mp3')
    console.log(something)
    return (
      <div className="App">
        <ReactHowler
          src="data:audio/wav;base64,"
          playing={this.state.playing}
        />
        <img
          alt="nas-record"
          id="record-img"
          style={{
            position: 'absolute',
            marginLeft: `${this.state.showRecord ? '47%' : 'auto'}`,
            marginRight: 'auto',
            left: 0,
            right: 0,
            height: '200px',
            zIndex: 1
          }}
          src="https://upload.wikimedia.org/wikipedia/commons/8/88/45_rpm_record.png"
        />
        <img
          onClick={this.showHideRecord}
          alt="nas-record"
          id="album"
          style={{
            position: 'absolute',
            marginLeft: 'auto',
            marginRight: 'auto',
            left: 0,
            right: 0,
            height: '200px',
            zIndex: 3
          }}
          src="https://upload.wikimedia.org/wikipedia/en/thumb/6/6b/NasIllmatic.jpg/220px-NasIllmatic.jpg"
        />
      </div>
    )
  }
}

export default App

